uint16_t demo_uart_read(uint8_t *buf)
{
	uint16_t read_len = demo_uart_rx_to_read_space();
	// uint8_t *temp = NULL

	if (read_len > DEMO_UART_READ_THRESHOLD) {
		read_len = DEMO_UART_READ_THRESHOLD;
	} else {
		return 0;
	}

	if (read_len > demo_uart->ring_buffer_size - demo_uart->read_ptr) {
		memcpy(buf, &demo_uart->ring_buffer[demo_uart->read_ptr], demo_uart->ring_buffer_size - demo_uart->read_ptr);
		memcpy(buf + (demo_uart->ring_buffer_size - demo_uart->read_ptr), &demo_uart->ring_buffer[0], read_len + demo_uart->read_ptr - demo_uart->ring_buffer_size);
	} else {
		memcpy(buf, &demo_uart->ring_buffer[demo_uart->read_ptr], read_len);
	}
	demo_uart->read_ptr += read_len;
	demo_uart->read_ptr %= demo_uart->ring_buffer_size;

	if (demo_uart->rx_disabled && demo_uart_rx_to_read_space() <= DEMO_UART_RX_ENABLE_SIZE) {
		// BT_LOGA("demo_uart rx enable! \r\n");
		demo_uart->rx_disabled = 0;
#if defined(DEMO_UART_USING_DMA) && DEMO_UART_USING_DMA
		UART_INTConfig(DEMO_UART_DEV, (RUART_BIT_ERBI | RUART_BIT_ELSI), DISABLE);
		UART_RXDMAConfig(DEMO_UART_DEV, DEMO_UART_DMA_RX_BURST_SIZE);
		UART_RXDMACmd(DEMO_UART_DEV, ENABLE);
		UART_RXGDMA_Init(DEMO_UART_INDEX, &demo_uart->GDMA_InitStruct, DEMO_UART_DEV, (IRQ_FUN)demo_uart_dma_recv_done, demo_dma_uart_recv_buff, SRX_BUF_SZ);
		UART_INTConfig(DEMO_UART_DEV, RUART_BIT_ETOI, ENABLE);
#else
		UART_INTConfig(DEMO_UART_DEV, RUART_BIT_ERBI | RUART_BIT_ETOI, ENABLE);
#endif
	}

	return read_len;
}

bool demo_uart_init(void)
{
	if (!demo_uart) {
		demo_uart = (struct demo_uart_t *)osif_mem_alloc(RAM_TYPE_DATA_ON, sizeof(struct demo_uart_t));
		if (!demo_uart) {
			BT_LOGE("demo_uart is NULL!");
			return false;
		}
		memset(demo_uart, 0, sizeof(struct demo_uart_t));
	}
	if (!demo_uart->ring_buffer) {
		demo_uart->ring_buffer = (uint8_t *)osif_mem_aligned_alloc(RAM_TYPE_DATA_ON, DEMO_UART_RX_BUF_SIZE, 4);
		if (!demo_uart->ring_buffer) {
			BT_LOGE("demo_uart->ring_buffer is NULL!");
			return false;
		}
		memset(demo_uart->ring_buffer, 0, sizeof(DEMO_UART_RX_BUF_SIZE));
	}
	demo_uart->ring_buffer_size = DEMO_UART_RX_BUF_SIZE;
	demo_uart->read_ptr = 0;
	demo_uart->write_ptr = 0;
	demo_uart->rx_disabled = 0;

	if (osif_sem_create(&demo_uart->tx_done_sem, 0, 1) == false) {
		BT_LOGE("demo_uart->tx_done_sem create fail!");
		return false;
	}
#if defined(CONFIG_AMEBALITE) && CONFIG_AMEBALITE
	/* Enable Clock */
	RCC_PeriphClockCmd(APBPeriph_UART0, APBPeriph_UART0_CLOCK, ENABLE);
	/* pinmux */
	Pinmux_Config(DEMO_UART_TX, PINMUX_FUNCTION_UART0_TXD);
	Pinmux_Config(DEMO_UART_RX, PINMUX_FUNCTION_UART0_RXD);
	Pinmux_Config(DEMO_UART_RTS, PINMUX_FUNCTION_UART0_RTS);
	Pinmux_Config(DEMO_UART_CTS, PINMUX_FUNCTION_UART0_CTS);
	/* pull up trx */
	PAD_PullCtrl(DEMO_UART_TX, GPIO_PuPd_UP);
	PAD_PullCtrl(DEMO_UART_RX, GPIO_PuPd_UP);
	PAD_PullCtrl(DEMO_UART_RTS, GPIO_PuPd_UP);
	PAD_PullCtrl(DEMO_UART_CTS, GPIO_PuPd_UP);
#endif
#if defined(CONFIG_AMEBASMART) && CONFIG_AMEBASMART
	/* Enable Clock */
	RCC_PeriphClockCmd(APBPeriph_UART0, APBPeriph_UART0_CLOCK, ENABLE);
	/* pinmux */
	Pinmux_Config(DEMO_UART_TX, PINMUX_FUNCTION_UART);
	Pinmux_Config(DEMO_UART_RX, PINMUX_FUNCTION_UART);
	Pinmux_Config(DEMO_UART_RTS, PINMUX_FUNCTION_UART_RTSCTS);
	Pinmux_Config(DEMO_UART_CTS, PINMUX_FUNCTION_UART_RTSCTS);
	/* pull up trx */
	PAD_PullCtrl(DEMO_UART_TX, GPIO_PuPd_UP);
	PAD_PullCtrl(DEMO_UART_RX, GPIO_PuPd_UP);
	PAD_PullCtrl(DEMO_UART_RTS, GPIO_PuPd_UP);
	PAD_PullCtrl(DEMO_UART_CTS, GPIO_PuPd_UP);
#endif
	/* Enable UART
	 * Use Flow Control (When rx FIFO reaches level, RTS will be pulled high)
	 * Use Baudrate 115200 (Default)
	 */
	UART_InitTypeDef *pUARTStruct = &demo_uart->UART_InitStruct;
	UART_StructInit(pUARTStruct);
	pUARTStruct->WordLen = RUART_WLS_8BITS;
	pUARTStruct->StopBit = RUART_STOP_BIT_1;
	pUARTStruct->Parity = RUART_PARITY_DISABLE;
	pUARTStruct->ParityType = RUART_EVEN_PARITY;
#if defined(DEMO_UART_USING_DMA) && DEMO_UART_USING_DMA
	pUARTStruct->RxTimeOutCnt = 65535;
#endif
	pUARTStruct->StickParity = RUART_STICK_PARITY_DISABLE;
#if defined(CONFIG_AMEBASMART) && CONFIG_AMEBASMART
	pUARTStruct->RxFifoTrigLevel = UART_RX_FIFOTRIG_LEVEL_16BYTES;
#else
	pUARTStruct->RxFifoTrigLevel = UART_RX_FIFOTRIG_LEVEL_HALF;
#endif
	pUARTStruct->FlowControl = ENABLE;
	UART_Init(DEMO_UART_DEV, pUARTStruct);
	RCC_PeriphClockSource_UART(DEMO_UART_DEV, UART_RX_CLK_XTAL_40M);
	UART_SetBaud(DEMO_UART_DEV, 3000000);

#if defined(DEMO_UART_USING_DMA) && DEMO_UART_USING_DMA
	/* Enable Uart High Rate Rx Path */
	UART_RxCmd(DEMO_UART_DEV, ENABLE);
	/* Rx DMA related */
	UART_INTConfig(DEMO_UART_DEV, (RUART_BIT_ERBI | RUART_BIT_ELSI), DISABLE);
	{
		/* timeout interrupt */
		InterruptRegister((IRQ_FUN)demo_uart_irq, DEMO_UART_IRQ, NULL, DEMO_UART_IRQ_PRIO);
		InterruptEn(DEMO_UART_IRQ, DEMO_UART_IRQ_PRIO);
		UART_INTConfig(DEMO_UART_DEV, RUART_BIT_ETOI, ENABLE);
	}
	// UART_RxDMADummyDataConfig(DEMO_UART_DEV, 0x55);
	UART_RxByteCntClear(DEMO_UART_DEV);
	UART_RXDMAConfig(DEMO_UART_DEV, DEMO_UART_DMA_RX_BURST_SIZE);
	UART_RXDMACmd(DEMO_UART_DEV, ENABLE);
	UART_RXGDMA_Init(DEMO_UART_INDEX, &demo_uart->GDMA_InitStruct, DEMO_UART_DEV, (IRQ_FUN)demo_uart_dma_recv_done, demo_dma_uart_recv_buff, SRX_BUF_SZ);
#else
	/* Disable and Enable UART Interrupt */
	InterruptDis(DEMO_UART_IRQ);
	InterruptUnRegister(DEMO_UART_IRQ);
	InterruptRegister((IRQ_FUN)demo_uart_irq, DEMO_UART_IRQ, NULL, DEMO_UART_IRQ_PRIO);
	InterruptEn(DEMO_UART_IRQ, DEMO_UART_IRQ_PRIO);

	UART_INTConfig(DEMO_UART_DEV, RUART_BIT_ETBEI, DISABLE);
	UART_INTConfig(DEMO_UART_DEV, RUART_BIT_ERBI | RUART_BIT_ELSI | RUART_BIT_ETOI, ENABLE);
	/* Enable Uart High Rate Rx Path */
	UART_RxCmd(DEMO_UART_DEV, ENABLE);
#endif

	BT_LOGA("Demo Uart Init Done \r\n");

	return true;
}
#endif
#endif

